#include <stdio.h>
#include <stdlib.h>

#define MOD 1000000007

int numberOfGoodPartitions(int* nums, int numsSize) {
    int* dp = (int*)malloc(sizeof(int) * (numsSize + 1));
    int* lastSeen = (int*)malloc(sizeof(int) * (numsSize + 1));
    int maxNum = 0;
    for (int i = 0; i < numsSize; i++) {
        if (nums[i] > maxNum) maxNum = nums[i];
    }
    int* last = (int*)malloc(sizeof(int) * (maxNum + 1));
    for (int i = 0; i <= maxNum; i++) last[i] = -1;

    dp[numsSize] = 1; // Base case
    for (int i = numsSize - 1; i >= 0; i--) {
        dp[i] = (2 * dp[i + 1]) % MOD;
        if (last[nums[i]] != -1) {
            dp[i] = (dp[i] - dp[last[nums[i]] + 1] + MOD) % MOD;
        }
        last[nums[i]] = i;
    }

    int result = dp[0];
    free(dp);
    free(last);
    free(lastSeen);
    return result;
}
